INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 1, "あたしだって\nやるときはやるよ！", 0.0, 1, 10040, 0, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24001);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 1, 10040, 1, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24002);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 1, 10040, 2, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24003);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 2, 10040, 3, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24004);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 1, 10040, 4, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24005);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 2, 10040, 5, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24006);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 2, "あたしも意外と\nやるもんでしょ？", 0.0, 2, 10040, 6, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24007);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 4, 10040, 7, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24008);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 4, 10040, 8, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24009);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 4, 10040, 9, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24010);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 4, "やられた…\nねずみって意外と\nてごわいね", 0.0, 4, 10040, 10, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24011);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 4, 10040, 11, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24012);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1.81, 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 4, 10040, 12, "リン", "2020/04/30 12:00:00", 24, 102601, 0.0, "2030/12/17 14:59:59", 24013);
